func resourceGlobalMetadataRead(d *schema.ResourceData, m interface{}) error {
	o := &vspk.GlobalMetadata{
		ID: d.Id(),
	}

	err := o.Fetch()
	if err != nil {
		d.SetId("")
		return nil
	}

	d.Set("name", o.Name)
	d.Set("last_updated_by", o.LastUpdatedBy)
	d.Set("description", o.Description)
	d.Set("metadata_tag_ids", o.MetadataTagIDs)
	d.Set("network_notification_disabled", o.NetworkNotificationDisabled)
	d.Set("blob", o.Blob)
	d.Set("global_metadata", o.GlobalMetadata)
	d.Set("entity_scope", o.EntityScope)
	d.Set("external_id", o.ExternalID)

	d.Set("id", o.Identifier())
	d.Set("parent_id", o.ParentID)
	d.Set("parent_type", o.ParentType)
	d.Set("owner", o.Owner)

	return nil
}

func resourceGlobalMetadataUpdate(d *schema.ResourceData, m interface{}) error {
	o := &vspk.GlobalMetadata{
		ID: d.Id(),
	}

	err := o.Fetch()
	if err != nil {
		return err
	}

	o.Blob = d.Get("blob").(string)

	if attr, ok := d.GetOk("name"); ok {
		o.Name = attr.(string)
	}
	if attr, ok := d.GetOk("description"); ok {
		o.Description = attr.(string)
	}
	if attr, ok := d.GetOk("metadata_tag_ids"); ok {
		o.MetadataTagIDs = attr.([]interface{})
	}
	if attr, ok := d.GetOk("network_notification_disabled"); ok {
		o.NetworkNotificationDisabled = attr.(bool)
	}
	if attr, ok := d.GetOk("global_metadata"); ok {
		o.GlobalMetadata = attr.(bool)
	}
	if attr, ok := d.GetOk("external_id"); ok {
		o.ExternalID = attr.(string)
	}

	o.Save()

	return nil
}

func resourceGlobalMetadataDelete(d *schema.ResourceData, m interface{}) error {
	o := &vspk.GlobalMetadata{
		ID: d.Id(),
	}

	err := o.Delete()
	if err != nil {
		return err
	}

	return nil
}
